window.bookSummaryJSON = "<p>After learning he has only months to live, Gemini Fowler is granted one shot to cheat death when a billionaire game developer offers to transfer his consciousness into a virtual realm using a technology that could end death as we know it.</p> <p>The catch: The only current VR with the capability to receive him is the unreleased video game, Enora Online, and Gemini must survive until level 10 or be completely wiped from the servers...and existence.</p> <p>Welcome to Enora Online, where virtual is reality.</p>"; 
